import './App.css';
import { FaTimes} from 'react-icons/fa';
import ReactTooltip from "react-tooltip";

function Todo({todo, onDelete, onCompleted}) {  
  return (
      <div 
      className={`Todo ${todo.completed ? 'Completed' : ''}`} 
      >
        <ReactTooltip />

          <p>
          <input
          type="checkbox"
          checked={todo.completed}
          onChange={() => onCompleted(todo.id)}
        />
          {todo.id} {todo.userId} {todo.title} 
          <FaTimes onClick={() => onDelete(todo.id)} className="DeleteTodo"/>
          </p>
      </div>
  );
}

export default Todo;
